import React from 'react';
import Navbar from './Navbar';
import Carousel from './Carousel';
import Services from './Services';
import Calculator from './Calculator';
import Enquiry from './Enquiry';
import {Switch,Route,Redirect} from 'react-router-dom';


import Contact from './pages/Contact';
import Personal from './pages/Personal';
import Business from './pages/Business';
import Property from './pages/Property';
import Car from './pages/Car';
import Discounting from './pages/Discounting';
import Capital from './pages/Capital';
import Overdraft from './pages/Overdraft';
import Term from './pages/Term';
import Vechicle from './pages/Vechicle';
import Equipment from './pages/Equipment';
import Credit from './pages/Credit';
import Bill from './pages/Bill';
import Factoring from './pages/Factoring';
import Bank from './pages/Bank';
import Ipo from './pages/Ipo';
import Private from './pages/Private';
import Quasi from './pages/Quasi';
import Promoter from './pages/Promoter';
import Shares from './pages/Shares';
import Project from './pages/Project';
import Infras from './pages/Infras';
import Contruction from './pages/Contruction';
import Agriculture from './pages/Agriculture';
import Homeloan from './pages/Homeloan';

function App() {
  return (
    <>
    <Navbar/>

    <Switch>
      <Route exact path="/contact" component={Contact}></Route>
      <Route exact path="/personalloan" component={Personal}></Route>
      <Route exact path="/homeloan" component={Homeloan}></Route>
      <Route exact path="/businessloan" component={Business}></Route>
      <Route exact path="/loanagainstproperty" component={Property}></Route>
      <Route exact path="/carloan" component={Car}></Route>
      <Route exact path="/leaserentdiscounting" component={Discounting}></Route>
      <Route exact path="/workingcaptialfinance" component={Capital}></Route>
      <Route exact path="/overdraftfacility" component={Overdraft}></Route>
      <Route exact path="/termloan" component={Term}></Route>
      <Route exact path="/commercialvechicleloan" component={Vechicle}></Route>
      <Route exact path="/equipmentfinance" component={Equipment}></Route>
      <Route exact path="/letterofcredit" component={Credit}></Route>
      <Route exact path="/billcounting" component={Bill}></Route>
      <Route exact path="/factoring" component={Factoring}></Route>
      <Route exact path="/bankguarantee" component={Bank}></Route>
      <Route exact path="/initialpublicoffering" component={Ipo}></Route>
      <Route exact path="/privateequity" component={Private}></Route>
      <Route exact path="/quasiequity" component={Quasi}></Route>
      <Route exact path="/promoterfunding" component={Promoter}></Route>
      <Route exact path="/loanagainstshares" component={Shares}></Route>
      <Route exact path="/projectreport" component={Project}></Route>
      <Route exact path="/infrastructurefinance" component={Infras}></Route>
      <Route exact path="/constructionfinance" component={Contruction}></Route>
      <Route exact path="/agriculturefinance" component={Agriculture}></Route>
      <Redirect to="/"/>
    </Switch>

    <Carousel/>
    <Services/>
    <Calculator/>
    <Enquiry/>
    </>
  );
}

export default App;
